import axios from "axios";
export default class WTSOImage {
    constructor(){
        this.proxy = "https://cors-anywhere.herokuapp.com/"; //CORS error work around
    }
    getSrc = () => {
        new Promise((resolve, reject) => {
            axios
            .get(this.proxy + "https://www.wtso.com", 
            {
                headers: { "X-Requested-With": "XMLHttpRequest" },
            })
            .then((response) => {
                resolve(response);

            })
            .catch((err) => {
                reject(err);
            });
        });
    }
}
